{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jarredpriester/machine-learning-ensemble-breast-cancer-prediction?scriptVersionId=92417114\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"be6a1892","metadata":{"papermill":{"duration":0.210633,"end_time":"2022-04-08T03:58:16.100723","exception":false,"start_time":"2022-04-08T03:58:15.89009","status":"completed"},"tags":[]},"source":["# Using a Machine Learning Ensemble to Make Breast Cancer Predictions\n","## Jarred Priester\n","## 1/12/2022"]},{"cell_type":"markdown","id":"f732393c","metadata":{"papermill":{"duration":0.195002,"end_time":"2022-04-08T03:58:16.502667","exception":false,"start_time":"2022-04-08T03:58:16.307665","status":"completed"},"tags":[]},"source":["1. Overview\n","  + 1.1 description of dataset\n","  + 1.2 goal of project\n","  + 1.3 steps to achieve goal\n","2. Data Cleaning\n","  + 2.1 downloading the data\n","  + 2.2 missing information\n","  + 2.3 scaling the matrix\n","3. Exploratory Data Analysis\n","  + 3.1 exploring the data\n","  + 3.2 visualization\n","4. Models\n","  + 4.1 setting up the models\n","  + 4.2 logistic regression\n","  + 4.3 random forest\n","  + 4.4 K nearest neighbors\n","  + 4.5 linear discriminant analysis\n","  + 4.6 Neural Network\n","  + 4.7 Ensemble\n","5. Results\n","  + 5.1 results table\n","  + 5.2 best model\n","6. Conclusion\n","  + 6.1 summary\n","  + 6.2 limitations\n","  + 6.3 future work"]},{"cell_type":"markdown","id":"af92f175","metadata":{"papermill":{"duration":0.195105,"end_time":"2022-04-08T03:58:16.889543","exception":false,"start_time":"2022-04-08T03:58:16.694438","status":"completed"},"tags":[]},"source":["# 1. Overview\n","\n","Something that we would all like to eradicate from our society is cancer. Unfortunately, cancer has effected our lives far too often. Thankfully, cancer research has advanced quite a lot in the past decades thanks in large part to advances in technology and in particular, machine learning. Hopefully this project will shine some light on the frame work of how machine learning can be used to further cancer research. "]},{"cell_type":"markdown","id":"48effa4e","metadata":{"papermill":{"duration":0.1975,"end_time":"2022-04-08T03:58:17.277737","exception":false,"start_time":"2022-04-08T03:58:17.080237","status":"completed"},"tags":[]},"source":["# 1.1 Decription of dataset\n","\n","The Breast Cancer Wisconsin (Diagnostic) Data Set is a popular data set from the University of California Irvine Machine Learning Repository. The data set consist of 529 rows and 32 columns. Each row represents a tumor sample and each column represents a feature, more details are below. \n","\n","The following is from UCI's Machine Learning Repository website:\n","\n","*Features are computed from a digitized image of a fine needle aspirate (FNA) of a breast mass. They describe characteristics of the cell nuclei present in the image.*\n","\n","*Separating plane described above was obtained using Multisurface Method-Tree (MSM-T) [K. P. Bennett, \"Decision Tree Construction Via Linear Programming.\" Proceedings of the 4th Midwest Artificial Intelligence and Cognitive Science Society, pp. 97-101, 1992], a classification method which uses linear programming to construct a decision tree. Relevant features were selected using an exhaustive search in the space of 1-4 features and 1-3 separating planes.*\n","\n","*The actual linear program used to obtain the separating plane in the 3-dimensional space is that described in: [K. P. Bennett and O. L. Mangasarian: \"Robust Linear Programming Discrimination of Two Linearly Inseparable Sets\", Optimization Methods and Software 1, 1992, 23-34].*\n","\n","1) ID number\n","2) Diagnosis (M = malignant, B = benign)\n","3-32)\n","\n","Ten real-valued features are computed for each cell nucleus:\n","\n","a) radius (mean of distances from center to points on the perimeter)\n","b) texture (standard deviation of gray-scale values)\n","c) perimeter\n","d) area\n","e) smoothness (local variation in radius lengths)\n","f) compactness (perimeter^2 / area - 1.0)\n","g) concavity (severity of concave portions of the contour)\n","h) concave points (number of concave portions of the contour)\n","i) symmetry\n","j) fractal dimension (\"coastline approximation\" - 1)"]},{"cell_type":"markdown","id":"c2f92eae","metadata":{"papermill":{"duration":0.186863,"end_time":"2022-04-08T03:58:17.6564","exception":false,"start_time":"2022-04-08T03:58:17.469537","status":"completed"},"tags":[]},"source":["# 1.2 Goal of the project\n","\n","The goal of this project will be to successfully create a model that could classify the given tumor samples into factors of malignant or benign. The metric we will use to determine success is the F1 score. The goal is to create a model that can achieve a F1 score of .9 or higher.\n"]},{"cell_type":"markdown","id":"a1f8cc38","metadata":{"papermill":{"duration":0.198396,"end_time":"2022-04-08T03:58:18.047481","exception":false,"start_time":"2022-04-08T03:58:17.849085","status":"completed"},"tags":[]},"source":["# 1.3 Steps to achieve this goal\n","\n","To achieve this goal we will first download, clean and analyze the dataset. We will then run 5 different algorithms that come up with the binary classification predictions of malignant or benign. We will then combine them to create an ensemble that takes the classification that appears the most for each sample . Lastly we will create a table of results and find the model with the highest F1 score."]},{"cell_type":"markdown","id":"2d2d433a","metadata":{"papermill":{"duration":0.188923,"end_time":"2022-04-08T03:58:18.432792","exception":false,"start_time":"2022-04-08T03:58:18.243869","status":"completed"},"tags":[]},"source":["# Data Cleaning\n","\n","# 2.1 downloading the data"]},{"c