"         Pos Pred Value : 0.977         \n","         Neg Pred Value : 0.986         \n","             Prevalence : 0.374         \n","         Detection Rate : 0.365         \n","   Detection Prevalence : 0.374         \n","      Balanced Accuracy : 0.981         \n","                                        \n","       'Positive' Class : M             \n","                                        "]},"metadata":{},"output_type":"display_data"}],"source":["cm_knn"]},{"cell_type":"markdown","id":"6176b2fc","metadata":{"papermill":{"duration":0.975587,"end_time":"2022-04-08T04:03:02.891047","exception":false,"start_time":"2022-04-08T04:03:01.91546","status":"completed"},"tags":[]},"source":["# 6. Conclusion\n","\n","# 6.1 summary\n","\n","We were able to create six different models that were able to classify the data set into malignant and benign, including an ensemble which combined the results of the first five models. Out of the six models, the most accurate was the K Nearest Neighbors model with a F1 score of ***.977***\n","\n","# 6.2 limitations\n","\n","The main limitation of this project is that the size of this data set is small. Would these models hold up to such a high accuracy on a big data set?\n","\n","# 6.3 future work\n","  \n","In my opinion this is a great starting place for predicting whether or not tumor samples are cancerous. In order to build on this model we would need to add tens of thousands of more samples and possibly more features. There might be other factors that doctors and researchers have found to be important such as family medical history, age, drugs or alcohol use, etc. Those might be relevant features to add to the data set. But all in all, this model is a great starting point for continuous breast cancer research."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"pa